import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      {/* Title for web app */}
      <p id="prefix" class="title">Hello, my name is</p>
      <p id="name" class="title">Rudy L. Pichola-Flores</p>
      <p id="description" class="title">I'm a software engineer based in Chicago, IL specializing in Computer Networks and Cybersecurity. Currently working at Northwestern Settlement as a web developer.</p>


    </div>
  );
}

export default App;
